import React from 'react';
import { Card } from 'react-bootstrap';

function ServerItem({server}) {
    const { id, name, ip, port  } = server;

    return (
        <Card key={id} className="wd-100"

        >
            <Card.Body>
                <Card.Title>{name}</Card.Title>
                <Card.Subtitle className="mb-2">{ip}</Card.Subtitle>
                <Card.Text>{`Порт: ${port}`}</Card.Text>
            </Card.Body>
        </Card>
    );
}

export default ServerItem;
